import React from 'react';
import Aux from '../../../Hoc/Aux/Aux';

const Receipt = (props) => (
    <Aux>
        <div className="ReceiptCardContainer">
            <div className="Shop">
                <span className="ReceiptCardTitle">
                    Shop:
                </span>
                {props.location}
            </div>
            <div className="Date">
                <span className="ReceiptCardTitle">
                    Date:
                </span>
                {props.date}
            </div>
            <div className="Item">
                <span className="ReceiptCardTitle">
                    Item:
                </span>
                {props.item}
            </div>
            <div className="Price">
                <span className="ReceiptCardTitle">
                Price:
                </span>
                {props.price}
            </div>
        </div>
    </Aux>
    );

export default Receipt;
